import React from 'react';
import './Work.css';
import StyledCard from '../StyledCard/StyledCard';

const About = () =>{
    return(
        <div>
            <NavigationBar/>
            <Card>
                <div className="overlay"></div>
                <StyledCard title="Projects?">
                    <div className="projectContainer">
                        <div className="project"></div>
                        <div className="project"></div>
                        <div className="project"></div>
                        <div className="project"></div>
                    </div>
                </StyledCard>
            </Card>
        </div>
        
    )
}

export default About;
